import React, { useState } from "react";
import Navbar from "react-bootstrap/Navbar";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal"

export default function Nav() {
  const [showModal, setModal] = useState(false);

  return (
    <Navbar style={{ marginBottom: 40 }}>
      <Navbar.Brand className="pink">Et Rewards</Navbar.Brand>
      <Navbar.Toggle />
      <Navbar.Collapse className="justify-content-end">
        <div>
          <Navbar.Brand style={{ paddingRight: 30 }} className="pink">
            Et Points: <span className="green"> 4</span>
          </Navbar.Brand>
        </div>
        <Button onClick={() => setModal(true)}>Add Points</Button>
        <Modal
          size="sm"
          show={showModal}
          onHide={() => setModal(false)}
        >
          <Modal.Header closeButton>
            <Modal.Title id="example-modal-sizes-title-sm">
              Small Modal
            </Modal.Title>
          </Modal.Header>
          <Modal.Body>...</Modal.Body>
        </Modal>
      </Navbar.Collapse>
    </Navbar>
  );
}
